(window.webpackJsonp=window.webpackJsonp||[]).push([[17],{707:function(n,r){n.exports='### _.curry(fn, arity = fn.length, ...args)\n\n函数柯里化。如果提供的参数 (args) 数量足够，则调用传递函数 f ，否则返回一个 curried 函数 f [&#x24C8;](https://github.com/MuYunyun/diana/blob/master/src/common/function/curry.ts "View in source")\n\n##### Arguments\n`fn` *(Function)* 调用函数\n\n`arity` *(Number)* 参数数量(可不传)\n\n`...args` *(any)* 剩余参数\n\n&nbsp;&nbsp;\n\n##### Example\n```js\n_.curry(Math.pow)(2)(10) // => 1024\n```'}}]);